import React, {Component} from 'react';
import {connect} from 'react-redux';
import {inputQuestion} from './actions/questionActions';

class PresentedQuestions extends Component {
    render() {
    };
}

const mapStateToProps = (state) => {
    return {
        user: state.user,
        math: state.math
    };
};

const mapDispatchToProps = (dispatch) => {
    return {
        inputQuestion: (values) => {
            dispatch(inputQuestion(values));
        }
    };
};

export default connect(null, mapDispatchToProps)(PresentedQuestions);
